  Refuge. Trails in this inventory are eligible for funding under the Refuge Roads
  Program (SAFETEA_LU). The report describes all the attributes (e.g., location, surface
  type, condition, distance) of trails in the FWS asset inventory.\",\n\t\"owner_org\":
